#!/usr/bin/env python3
# https://leetcode.com/problems/surrounded-regions/

import unittest

from typing import List


class Solution:
    def __key(self, i, j):
        return (int(i) << 32) | j

    def __i(self, key):
        return int(key >> 32)

    def __j(self, key):
        return int(key & 0xFFFFFFFF)

    def __enqueue(self, i, j, check, visited):
        key = self.__key(i, j)
        if key not in visited:
            check.append(key)
            visited.add(key)

    # pylint: disable=R0912
    def solve(self, board: List[List[str]]) -> None:
        if board is None or len(board) == 0:
            return
        for row in board:
            if row is None or len(row) == 0:
                return
        check = []
        visited = set()
        for i, _ in enumerate(board):
            self.__enqueue(i, 0, check, visited)
            self.__enqueue(i, len(board[i]) - 1, check, visited)
        for j, _ in enumerate(board[0]):
            self.__enqueue(0, j, check, visited)
        for j, _ in enumerate(board[-1]):
            self.__enqueue(len(board) - 1, j, check, visited)
        while check:
            key = check[0]
            check.pop(0)
            i = self.__i(key)
            j = self.__j(key)
            if i < 0 or j < 0 or len(board) <= i or len(board[i]) <= j:
                continue
            if board[i][j] == 'O':
                board[i][j] = 'V'
                self.__enqueue(i + 1, j, check, visited)
                self.__enqueue(i - 1, j, check, visited)
                self.__enqueue(i, j + 1, check, visited)
                self.__enqueue(i, j - 1, check, visited)
        for i, _ in enumerate(board):
            for j, _ in enumerate(board[i]):
                if board[i][j] == 'O':
                    board[i][j] = 'X'
                elif board[i][j] == 'V':
                    board[i][j] = 'O'


class TestCode(unittest.TestCase):
    def construct(self, compact):
        board = []
        for i, _ in enumerate(compact):
            board.append(list(compact[i]))
        return board

    def test_small(self):
        compact = ['XXXX', 'XOOX', 'XXOX', 'XOXX']
        board = self.construct(compact)
        Solution().solve(board)
        expected = ['XXXX', 'XXXX', 'XXXX', 'XOXX']
        for i, _ in enumerate(board):
            self.assertEqual(expected[i], ''.join(board[i]))

